CREATE TABLE GOODS 
   (	GOODS_NO NUMBER, 
	GOODS_NAME VARCHAR2(50 BYTE), 
	GOODS_SIZE VARCHAR2(20 BYTE), 
	GOODS_TYPE VARCHAR2(50 BYTE), 
	 GOODS_PRICE  number, 
	 GOODS_EFFICIENT  number, 
	 GOODS_FUEL  VARCHAR2(50 BYTE), 
	 BRAND_CODE  NUMBER, 
	 GOODS_CODE  NUMBER
   ) 

   COMMENT ON COLUMN  GOODS . GOODS_NO  IS '상품번호';
   COMMENT ON COLUMN  GOODS . GOODS_NAME  IS '상품차량명';
   COMMENT ON COLUMN  GOODS . GOODS_SIZE  IS '상품차량차종';
   COMMENT ON COLUMN  GOODS . GOODS_TYPE  IS '상품차량타입';
   COMMENT ON COLUMN  GOODS . GOODS_PRICE  IS '상품가격';
   COMMENT ON COLUMN  GOODS . GOODS_EFFICIENT  IS '상품차량연비';
   COMMENT ON COLUMN  GOODS . GOODS_FUEL  IS '상품차량연료';
   COMMENT ON COLUMN  GOODS . BRAND_CODE  IS '상품차량브랜드코드';
   COMMENT ON COLUMN  GOODS . GOODS_CODE  IS '상품코드';
   
CREATE SEQUENCE goods_seq
START WITH 1
INCREMENT BY 1;

